import React from "react";
import { Link } from "react-router-dom";

function Header() {
  return (
    <nav
      style={{
        display: "flex",
        justifyContent: "space-around",
        padding: "10px",
        borderBottom: "1px solid white",
      }}
    >
      <Link to="/" style={{ color: "white", textDecoration: "none" }}>
        Test1
      </Link>
      <Link to="/test2" style={{ color: "white", textDecoration: "none" }}>
        Test2
      </Link>
      <Link to="/test3" style={{ color: "white", textDecoration: "none" }}>
        Test3
      </Link>
    </nav>
  );
}

export default Header;
